INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(5, '2010-04-11 07:06:49', '<p>Amazonite is a potassium aluminum silicate, a microcline variety of feldspar, found in granite pegmatite and metamorphic rocks. It is usually associated with quartz and albite. The beautiful pale to deep blue green color is caused by copper traces in the mineral.</p>      <p>Amazonite derives its name from an early mistaken belief that it was found only in the land of the Amazon women of South America. The gem actually is found in several areas, the Ural Mountains of Russia once being the primary source. Colorado Amazonite was first exhibited at the 1879 World&#39;s Fair, and this put an end to the belief that quality Amazonite was only found in the Ural. Fine crystals from Colorado&#39;s Pikes Peak area, often associated with Smoky Quartz, make desirable additions to any mineral collection. Gem quality Amazonite is also found in Amelia County, Virginia, at the Moorefield and the Rutherford mines. There is a tale that Marie Antoinette once owned a set of fine Virginia Amazonite jewelry! <br /> Amazonite was used by the ancient Egyptians as Amulets and for inscribed tablets. Objects of Amazonite were found in Tutankhamen&#39;s tomb. The gem was used by the Mesopotamians and the Assyrians, who used it in ceremonies for their god Bells. Amazonite artifacts from Pre-Columbian Central and South America have also been found. </p>      <p>Good gem material is rare, but the stone is used for cabochons and beads, and some carvings. The main sources of Amazonite today are Brazil, India, Tanzania, Madagascar, Canada and the U.S.</p> <p>Metaphysical Properties: Amazonite soothes emotions and brings a calm tranquility to the heart. Its blue green color is like the watery world of the unconscious and the flow of emotions, and it allows one to see this ebb and flow of one&#39;s emotional energy without judgment of self. It brings one beyond duality, to accept what exists in one&#39;s life at the time and understand its purpose more fully. It may open the emotional body to higher vibrations that can seem overwhelming until they are fully integrated. Amazonite gently balances emotions, rational thought and intuition so one may see life clearly. It aids the &quot;inner warrior&quot; and helps with setting goals and standing firm about taking responsibility for one&#39;s life and attitudes, to achieve one&#39;s true heart&#39;s desire. It aids truth and clarity in communication and self-expression, and in problem solving. It eases depression and apprehensive feelings. A stone of hope and new life, of renewal and springtime. It is a good stone for Beltane or Mayday ceremonies. A stone for harmony and compassion in love and all relationships, include self-love and acceptance of one&#39;s own true unique and individual nature. Chakra&rsquo;s Heart and Throat.</p>', 'Amazonite', 'Amazonite.jpg', 'Amazonite.jpg', 2073, 'amazonite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(6, '2010-04-10 19:26:10', '<p style="text-align: center"><img alt="coral" width="150" height="135" src="http://www.stonegoddess.com/images/image/Stones/Coral-1.jpg" /></p>\r\n<p>Coral is one of the gemstones of organic origin. It is created by tiny anemone like sea creatures, the coral polyps, which remove calcium carbonate from the water and deposit it in their tissues as crystalline calcite. The coral reefs or atolls are found in warm shallow coastal waters. The Mediterranean, Gulf of Biscay, Canary Islands, Malaysia, Midway Islands, Japan and Hawaii are all areas where coral is harvested. In the past it was harvested by divers, but now a weighted wide-mesh net is used to dredge the seabed. <br />\r\nTorre del Greco, south of Naples, Italy has been the main center of the trade and processing of coral for centuries. Over half of the world''s coral harvest is still processed there. The name coral comes from Greek &quot;Korallion&quot;, also Gorgeia from the myth of Perseus slaying the Medusa. Medusa''s drops of blood are said to have become red coral. It was thought to be the life essence of the Mother Goddess who lived on a &quot;tree&quot; of coral in the ocean.</p>\r\n<p>Coral colors range from deep red &quot;oxblood&quot; to pale pink Pelle D''Angello, or &quot;Angel Skin&quot;. Corallium Rubrum or Corallium Nobile, &quot;precious coral&quot;, is most valued as a gem. Black coral is found in Hawaii, and a blue coral is also used for beads and ornaments. Today much coral is harvested in the P acific, around Japan and other islands. This coral is larger and has a white center that distinguishes it from Mediterranean coral. It is called &quot;fiore blanca&quot;, or white flower by the Italians. One must also be wary of imitations, as some even show false growth rings that fool the buyer.</p>\r\n<p>Coral has been valued since Paleolithic times. It was a source of wealth in some cultures, used to decorate clothing and as jewelry or statues. In India, Tibet and China coral is a valued gem. Marco Polo wrote of coral accents on Tibetan temples. In China, Red coral hat buttons were used for high ranking Mandarins. In early Rome, coral was used to protect children from ill health and to drive away evil spirits. It was though that coral would fade if the wearer became ill and regain it''s deep color when health returned. Coral branches were tied to cradles and on babies''s necks. It was also used in teething, even in Victorian England and America. The &quot;coral and bells&quot; was a baby''s teething toy that also drove away evil with it''s sound. <br />\r\nWomen used coral to regulate menstrual cycles, and as an aid in childbirth. It was also a talisman against the evil eye and witches, lightning strikes and bad dreams, and to protect travelers or ships at sea. The Pueblo Indians create red coral fetishes, and Tibetans have prayer malas of red coral beads. Hindus believe it to be a blood purifier which calms anger, jealousy or hatred. <br />\r\nMetaphysical Properties: Vibrant red coral is used as a protective amulet. It also helps the wearer access inner warrior energy or wildness, to gain confidence and be determined to reach goals. It aids decision making, and helps in creative projects and visualization. Red coral helps with survival issues, and helps motivate one to find the energy and passion needed to take a stand in life and do what is necessary. It also attracts love and passion, stimulates sexual energy, and may balance emotions to create harmony. Pink coral is a gentle heart stone, and blue coral aids communication, while black coral also helps remove negativity. Red coral is used in FENG SHUI, hung in the home to clear negativity and to protect the occupants, and for good luck.</p>\r\n<p>Chakras: Root, Spleen and Solar Plexus.</p>', 'Coral', '', '', 1101, 'coral');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(4, '2010-04-10 14:16:07', '<p>Bloodstone is a silicon dioxide mineral, one of a group of microcrystalline quartz that includes chalcedony, jasper, agates and other stones. It is the dark green chalcedony or jasper with red spots, although the red may not always be present. The red is caused by iron oxide inclusions, while the green is chlorite, an iron precipitate. It is formed near the earth&#39;s surface, at low temperatures, and occurs in rock cavities as mammillary or botryoidal forms, or crusts. </p>      <p>Bloodstone, or &quot;Blood Jasper&quot; as it was called in medieval times, has been used for centuries to cure various health problems associated with the blood, the liver or kidneys. The cool, wet stone was applied to a wound to help stop blood flow. It was worn by soldiers as amulets for courage and strength, and to protect against wounds in battle. The stone was also known as &quot;Matyr&#39;s Stone&quot;, and was thought to have formed when drops of Christ&#39;s blood fell upon green jasper lying at the foot of the cross. It represented Christ&#39;s passion and sacrifice, and was thought to have special healing powers. Carvings of the Crucifixion or the head of Christ were made of this stone in the Middle Ages. </p>      <p>In Ancient Babylon, the Bloodstone was used for seals and amulets. Seals and rings of the stone have been worn for centuries, for courage and strength and protection. It also was thought to bring success in legal or business matters, and to attract good health, wealth and luck. In Medieval Europe the stone was called &quot;Heliotrope&quot;, from an old belief that, when placed in water, it could turn the sun red. Bloodstone was also used by the native peoples of Mexico and Central America, where it was carved into heart shapes and used for problems with the blood or internal organs. </p>      <p>Bloodstone is found in the U.S., China, Russia and Australia, but the main ancient and modern source is the Deccan Plateau of India. The gem makes attractive beads and cabochons for jewelry, and is carved into animals, spheres, eggs, and other objects.  </p>      <p>Metaphysical Properties: Bloodstone is a gem for courage and strength. It is a stone for the Heart, to purify the blood and the emotions and to enhance stability during times of chaos before transformation. It encourages self-confidence, and the use of caution. It eases and heals anger, impatience and aggression, and helps fend off obstacles in one&#39;s life. It allows for honesty and integrity, as we speak from the heart, and encourages us to remember our roots and stay true to ourselves on our journey. It is an earthling or grounding stone, and helps keep our hearts in tune with the earth&#39;s heartbeat, or electromagnetic field. It is helpful during shifts of frequency, which may cause chaos. It allows access to our ancient ancestors, our &quot;blood lines&quot;, and helps gain valuable knowledge from these traditions. It is a protective stone, and attracts good health and fortune. It may also be used to affirm a commitment to work to improve one&rsquo;s health, and a desire for long life. It is used for toxin release and balances blood elements, to help with problems of blood and internal organs and circulation. It may be an aid for menstrual problems, help prevent miscarriage and is an aid during childbirth. It helps align the lower Chakras with the heart.  </p> Chakras: Heart, Root and Spleen.', 'Bloodstone', 'bloodstone.jpg', 'bloodstone.jpg', 1464, 'bloodstone');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(7, '2010-04-10 14:15:57', '<p style="text-align: center"><img alt="amber" width="140" height="117" src="http://www.stonegoddess.com/images/image/Stones/amber.jpg" /></p>\r\n<p>AMBER is fossilized resin from trees that grew up to fifty million years ago, in the Eocene and Oligocene Periods. The color ranges from golden yellow to honey and deep reds. There are also rare green and blue amblers. Insect or plant remains or air bubbles caught in the sap add to its beauty.</p>\r\n<p>Amber rubbed with silk or wool becomes electrically charged, and ancient Greeks called it &ldquo;Elektra&rdquo;. It has been found in Neolithic graves in Europe, dating to 15,000 BC. It was popular with the early Greeks and Romans, Phoenicians and Etruscans. It is highly valued in Morocco, Somalia and Egypt and in Tibet and China. Its use is ornamental and protective.</p>\r\n<p>Once thought to be the golden rays of the sun congealed by the sea, it brings the joy and happiness of the sun to all who enjoy it&rsquo;s warmth and beauty. Baltic Amber is most often seen, while Amber from Burma, Sicily, Rumania, Mexico and the Dominican Republic is also available.</p>\r\n<p>Metaphysical Properties: Amber has a high vibration and helps balance the Endocrine system and digestion, and stabilize other body organs. It helps open energy channels to aid in raising the Kundalini, and helps connect us to our own fire energy centered in our solar plexus. Amber used in meditation helps connect us to our inner wisdom for clarity and enlightenment. It can also be used to gain knowledge of past cycles on earth, and it stores ancient DNA. Amber&rsquo;s vibrant, rich solar hues are soothing to people suffering from depression, which may be caused by partial &ldquo;soul loss&rdquo;. It can be useful as a talisman</p>\r\n<p>During dark times of emotional pain or disturbing thoughts, and can help one reconnect with their willpower and personal strengths. It is useful as a protective amulet or to attract love into one&rsquo;s life. Small bits may be burned as incense offerings.</p>\r\n<p>Chakra Affiliation: Solar Plexus.</p>', 'Amber', '', '', 1193, 'amber');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(8, '2010-04-10 14:16:02', '<p>Apophyllite is a hydrated potassium calcium silicate. It forms crystals with a color range from clear to pale green, and occurs often with zeolites of hydrothermal origin. Good specimens of this mineral, with Prehnite or Stilbite come from Fairfax County, Virginia. Many beautiful examples are from Poona, India. </p>      <p>Metaphysical Properties: Apophyllite helps maintain a gentle awareness of the physical dimension while exploring the astral realms for information or guidance. Like a soft flight on angel&rsquo;s wings, it acts as a bridge between the higher self and the physical, earthly body. It helps honor the sacredness of the body&rsquo;s wisdom and it&rsquo;s Beings&rdquo;. It can also spark a soft fire of unconditional love for self and others that leads to wisdom. </p>      <p>This crystal allows one to see the future, and the pyramids of Apophyllite may be used to enhance energy used for clairvoyance. It is also helpful for communing with water elemental or beings and the divas associated with these particular crystals.  </p> Chakra Affiliations: Crown and Brow.', 'Apophyllite', 'Apophyllite.jpg', 'Apophyllite.jpg', 1190, 'apophyllite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(9, '2010-04-11 08:40:18', '<p>     Azurite is a copper carbonate, found with Malachite in weathered layers of copper deposits. In the Middle Ages, Azurite was ground to produce deep blue pigments, as Malachite was used to create rich green hues. Fine specimens come from the U.S. southwest, and Morocco.</p>  <p>     Metaphysical Properties: Azurite is a &ldquo;sky stone&rdquo; and a &ldquo;third eye&rdquo; stone. It&rsquo;s deep blue enables one&rsquo;s mind to open to intuitive guidance. It helps one become aware of psychic ability. It is a good meditation stone, and can help with telepathic communication and spirit guide contact.</p>  Chakra Affiliation: Brow.', 'Azurite', 'Azurite.jpg', 'Azurite.jpg', 1386, 'azurite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(10, '2010-04-10 21:23:21', '<p>     Celestite is a strontium sulfate, which forms crystal filled cavities in limestone or sandstone sedimentary rock. It was first discovered in the late 18th century in Blair Co. Pennsylvania, and named for it&rsquo;s beautiful celestine blue color. A minute amount of gold present in the crystal may create this hue. Most Celestite presently available is from Madagascar. Specimens from Pennsylvania, particularly the Mencklen Quarry, are sometimes seen.</p><p>Metaphysical Properties: Celestite calms and soothes the spirit. It aids in forgiveness for self and others. It helps one contact the angelic realm for guidance and protection, and promotes spiritual growth. It enhances the ability to receive clairaudient and clairvoyant messages. This stone is useful for extraterrestrial communication, and for a clearer understanding of Earth&rsquo;s place and purpose in the scheme of things.</p><p>Chakra Affiliations: Brow and Crown.</p>', 'Celestite', 'Celestite.jpg', 'Celestite.jpg', 1190, 'celestite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(11, '2010-04-08 02:55:02', 'Chrysocolla is a copper silicate, which is sometimes mistaken for Turquoise. Its beautiful blue green color calms the mind and heart, and can help restore peace and harmony. This stone is also an ally when one needs to &ldquo;speak one&rsquo;s truth&rdquo;, bringing strength and clarity to the speaker.<br /> Chakra Affiliations: Throat and Heart.', 'Chrysocolla', 'Chrysocolla.jpg', 'Chrysocolla.jpg', 1099, 'chrysocolla');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(12, '2010-04-10 15:14:04', '<p style="text-align: center"><img alt="jet" width="117" height="114" src="http://www.stonegoddess.com/images/image/Stones/jet.jpg" /></p>\r\n<p>Jet is fossilized wood, lignite coal formed in the Jurassic Period. Like Amber, it becomes electrically charged when rubbed, and it has been called &ldquo;Black Amber&rdquo;. It is easily carved and polished, and was associated with mourning in Victorian times.</p>\r\n<p>Metaphysical Properties: Similar to Obsidian. A protective stone which absorbs negativity, a stabilizer during adversity and good for divining and psychic awareness. In old Ireland, fisherman&rsquo;s wives burned Jet to aid in their husband&rsquo;s safe return from sea. In Crystal healing work, Jet is useful for aligning the lower Chakras. <br />\r\nChakra Affiliation: Root.</p>', 'Jet', '', '', 995, 'jet-fossilized-wood');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(13, '2010-04-10 14:15:08', '<p>     Kyanite is an Aluminum Silicate that grows as flat blades of blue crystals. It has an industrial use for the porcelain insulators of spark plugs and ovens.</p><p>Metaphysical Properties: Kyanite does not absorb negative energies and needs no clearing. It is a calming stone, and aids communication. It helps with personal clarity in thoughts and emotions. It is useful in meditation, accessing spirit guides and for dream recall.</p><p>Chakra Affiliation: Throat.</p>', 'Kyanite', 'Kyanite.jpg', 'Kyanite.jpg', 1007, 'kyanite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(14, '2010-04-10 14:16:22', '<p style="text-align: center"><img alt="labradorite" width="125" height="132" src="http://www.stonegoddess.com/images/image/Stones/Labradorite.jpg" /></p>\r\n<p>Labradorite is an aluminum silicate from the plagioclase feldspar group. It occurs as rock masses and as plutonic intrusive formations and in basalt flows of volcanic origin. This beautiful stone has a quality called Labradorescence that creates brilliant flashes of blue, green or gold upon its surface. Much Labradorite and Spectrolite mined in Norway and Finland is used as decorative stone for buildings. Labradorite from Madagascar and other countries is used in stone carvings and fine jewelry that rivals in popularity that made from its &ldquo;sister&rdquo; feldspar Moonstone.</p>\r\n<p>Metaphysical Properties: Labradorite is a protective stone which shields the aura from detrimental energies and helps one to remain centered upon one&rsquo;s spiritual purpose. It aligns the physical and ethnic bodies and helps blend the rational and intuitive aspects of self. An aid in meditation, it helps connect one with universal energies and grounds this spiritual essence into the physical self to raise conscious awareness. Spectrolite opens the subconscious for flashes of intuitive wisdom and problem solving. It also aids physical, mental and emotional endurance.</p>\r\n<p>Chakra Affiliations: Upper Heart and Brow.</p>', 'Labradorite', '', '', 1080, 'labradorite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(15, '2010-04-10 14:16:27', '<p>     Limonite is an Iron Oxide that occurs in various forms. The Limonite crystals we have in the shop are pseudomorphs after Pyrite. They are perfect cubes, also called &ldquo;Devil&rsquo;s Dice&rdquo;.</p><p>Metaphysical Properties: Limonite can be used to promote strength and stability in one&rsquo;s life. It can increase stamina to protect one from negative thoughts or psychic attack.</p><p>Chakra Affiliation: Root.</p>', 'Limonite', 'Limonite.jpg', 'Limonite.jpg', 1465, 'limonite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(16, '2010-04-10 14:16:35', '<p>     Malachite is a copper carbonate that occurs in the oxidation zone of copper deposits. It is a replacement mineral for Azurite, with which it is associated. It grows in many beautiful forms, botryoidal masses and rare crystals, a shiny velvet or dark green, or Malachite &ldquo;flowers&rdquo;. A stone sacred to ancient Egyptians, used by them for cosmetics, pigments, protective amulets and healing. The natural color bands resemble a Peacock&rsquo;s Eye&rdquo;, and were thought to guard against evil. In Czarist Russia, Malachite mined in the Ural Mountains was used in carvings and architectural accents. Most Malachite now available is from Zaire, and some is from the U.S. southwest.</p><p>Metaphysical Properties: The deep green vibrations of Malachite bring abundance into one&rsquo;s life. It helps ease depression and soothes and cleanses the emotional body, and helps strengthen the heart. It is also a stone to aid in transformation and in the rebirth of spirit and the regeneration of cells in the physical body. Its high copper content works with the body&rsquo;s energy field and helps balance Chakras.  <br />Chakra Affiliations: Heart and Spleen. </p>', 'Malachite', 'Malachite.jpg', 'Malachite.jpg', 979, 'malachite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(18, '2010-04-10 14:15:18', '<p style="text-align: center"><img alt="malachite-azurite" width="118" height="89" src="http://www.stonegoddess.com/images/image/Stones/Malachite-Azurite.jpg" /></p>\r\n<p>Malachite/Azurite combined can calm the emotions and thoughts, ease fears and help with understanding the roots or causes of physical dis-ease and energy blockages within the body. It helps gain insights about issues that can be used to bring integration and healing. It helps with the release of ego and surrender to one&rsquo;s higher self.</p>\r\n<p>Chakra Affiliations: Heart, Brow and Spleen.</p>', 'Malachite-Azurite', '', '', 954, 'malachite-azurite-combined');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(19, '2010-04-11 08:22:50', '<p>     Obsidian is a high silica lava, or Volcanic Glass&rdquo;. Shiny black or microcrystals within the rock may reflect rainbow colors or a gold or silver sheen. Mahogany Obsidian is a mottled brown and black. Snowflake Obsidian is black with white crystallite clusters. Lapidaries value all forms of the mineral.  <br />      Obsidian was highly valued by the Aztec and Mayan peoples. The Mayans had developed a great trade in this material. It was used for ceremonial purposes, for tools and projectile points and for psychic protection or for gazing.</p><p>Metaphysical Properties: Obsidian is a mirror into the shadow side of self. Not for the timid, to be used with complete honesty and integrity as negative aspects reveal themselves and are worked on for integration and wholeness. It is used to absorb negative energies, as spheres or large points. Arrowheads buried outside at the corners of your home protect property and deflect or absorb negativity. An arrowhead worn as a pendant can help deflect evil intent. These points can also be used in depossession work and in sacred circles. Gold or silver sheen obsidian spheres are seer stones useful for scaring.</p><p>Chakra Affiliation: Root.</p>', 'Obsidian', 'Obsidian.jpg', 'Obsidian.jpg', 3342, 'obsidian');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(20, '2010-04-10 14:40:48', '<p>Sodalite is a sodium aluminum silicate found in igneous and plutonic rocks. This blue stone is often confused with Lazurite or &ldquo;Lapis Lazuli&rdquo;. Lapis usually contains pyrite inclusions, while Sodalite does not. Much Sodalite is mined in Bahia, Brazil and South Africa for use as decorative stone. It is also found in Ontario and British Columbia and in Maine in small masses. There is a pink variety called Hackmanite. </p>      <p>Metaphysical Properties: Sodalite creates inner harmony and helps gently open the third eye. It aids in communication and creativity. It polarizes the Masculine/Feminine energies of one&rsquo;s self and works with the endocrine system.  </p> Chakra Affiliations: Throat and Brow.', 'Sodalite', 'Sodalite.jpg', 'Sodalite.jpg', 1031, 'sodalite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(21, '2010-04-11 08:14:12', '<p>Selenite is a hydrous calcium sulfate, a transparent crystalline form of Gypsum that grows as white or colorless tabular or needle-like crystals. It is formed as a sedimentary mineral that remains after seas or saline waters evaporate. It sometimes occurs with massive gypsum, anhydrite, calcite, celestite or other evaporates minerals. It may also be formed at fumaroles or hot volcanic springs. Selenite&rsquo;s silky sheen and pearly luster show clearly why it derives its name from the Greek &quot;Selenite&quot; for moonstone, and from the ancient Goddess Selene. Moonstone, however, is feldspar and is a different mineral.  </p>      <p>Gypsum is used in plaster of Paris, cement and as fertilizer or a pottery flux, but Selenite is prized mostly as beautiful mineral specimens for collectors and in decor to bring a touch of nature&#39;s fascinating crystal forms into the home. </p>      <p>There are many collecting areas for Selenite in the U.S. and around the world, particularly Italy, Morocco. And Mexico. The most spectacular growth of Selenite crystals ever found is in Mexico&#39;s Naica Mountains, about fifty miles southeast of Chihuahua City. In 1918, employees of the Naica Mining Co. who were searching for lead, zinc, copper and silver or gold, discovered a 250&#39; long cave filled with enormous Selenite crystals, some as large as a person! Their magical find was named the Cave of Swords and has been protected from mining. Then, in April 2000, two brothers employed at Naica Mine discovered two new caves, one with a 24&#39; room filled with huge specimens of the white crystals and another cave where some crystals have grown to be forty feet long and six feet across! The new discovery is the &quot;Crystal Cave&quot; and will have a glass observation area so visitors may enjoy these wonderful megacrystals, but be protected from the high heat and humidity that is the natural home to these unique formations. </p>      <p>Metaphysical Properties Selenite&#39;s vibration creates a gentle parting of the veils, bringing access to the angelic realm for guidance and to learn about one&#39;s higher self and the soul&#39;s purpose in this incarnation. It may also help one to access past lives or potential future events, as one rubs the stone&#39;s striations for recorded images that may be revealed during meditation. Selenite aids in divine expression in daily life. It helps with forgiveness, which is necessary for emotional balance. It may be used with Rose Quartz for this purpose. In auric healing, Selenite may be used as an &quot;auric comb&quot; to remove entities and negative thoughts attached or tangled in the aura. The person&#39;s aura may be combed from head to foot with the Selenite for this. Selenite may also be used along the spine, from the base to the back of one&#39;s head to help remove blockages and restore proper energy flow. </p>      <p>It is a useful crystal for scrying or gazing, similar to clear quartz. It&#39;s ability to seem to glow with a pure inner white light helps the mind focus to enter a higher consciousness. Associated with the moon, and the element water and Pisces.</p>  Chakras: Crown and Brow.', 'Selenite', 'Selenite.jpg', 'Selenite.jpg', 1343, 'selenite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(22, '2010-04-11 04:26:00', '<p>Aquamarine is a beryllium aluminum silicate. It is the blue to blue-green member of the beryl family, which includes Emerald, Golden Heliodor, Morganite and Goshenite. Aquamarine is found in pegmatite rock, often associated with quartz, microcline and Muscovite. Aquamarine means &quot;sea water&quot;, and the stone has been believed to protect sailors and ships from misfortune at sea for centuries. It was also thought to bring clairvoyant ability and good health and memory to the wearer. </p>      <p>Aquamarine is used in fine and beautiful jewelry, the best quality stones coming from alluvial deposits in Brazil and the Ural Mountains. Beautiful specimens have been found in Pakistan. China, India, Madagascar and the U.S. Have produced desirable Aquamarines. Amelia County, Virginia has wonderful specimens. The old Dobbins Mica Prospect is still a source for rockbound and collector. </p>      <p>Metaphysical Properties: The cool blue shades of Aquamarine reduce stress and soothe emotions. It is a stone of peace and calmness, and may help the wearer achieve freedom from fears. It is a gem of joy and love, shields the aura, and helps align the Chakras. A gem associated with the element water and the moon, it is used for divination when placed in a bowl of water and gazed upon. A talismans for protection on journeys on or over water. A stone for world peace.  </p> Chakra: Throat.', 'Aquamarine', 'Aquamarine.jpg', 'Aquamarine.jpg', 1174, 'aquamarine');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(23, '2010-04-10 20:26:30', '<p>Angelite is a compressed form of Celestite, formed over millions of years. It is found in Peru, Britain, Mexico, Poland and Egypt. It shares many of Celestite&#39;s attributes. A gentle blue color, it is a stone that promotes balance and peace of mind. It is useful for astral travel, and to access the angelic realm and one&#39;s higher self. Angelite is a stone for forgiveness, and a protective stone that can help dispel anger. A stone for calmness and courage in speech.  </p> Chakras: Throat, Brow and Crown', 'Angelite', 'Angelite.jpg', 'Angelite.jpg', 1256, 'angelite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(24, '2010-04-10 14:15:25', '<p style="text-align: center"><img alt="opal" width="120" height="118" src="http://www.stonegoddess.com/images/image/Stones/Opal.jpg" /></p>\r\n<p>Opal is a hydrous silica dioxide that precipitates from a silica rich solution, l leaving a solid gel in small veins or crusts or nodules in sandstone or limestone. Opal may contain up to 30% water and its color play or &quot;opalescence&quot; is caused by globules of the silica mineral Cristobalite suspended in layers of the stone. Opal has many forms and colors. The basic groups are common opal, the red fire opal and the precious opals that include white, black, boulder, crystal and others. In 1889 Australia''s rich opal deposits were discovered in New South Wales. In 1915 Coober Pedy began production of White precious opal, and in 1903 Black Opal was found at Lightning Ridge.</p>\r\n<p>Since then, Australia has continued to produce fine opals. Honduras, Mexico and Peru are modern sources. In the U.S., Virgin Valley, Nevada, Idaho and Oregon are sites of opal collecting. <br />\r\nThe name Opal derives from Sanskrit &quot;Upala&quot; for valuable stone. It was thought of as the &quot;Goddess of Rainbows&quot;. Amulets with Opal were worn to protect the wearer from disease. In Ancient Rome, Opal was thought to give powers of foresight and prophecy to the wearer. It was also believed to improve eyesight Considered bad luck by some Opal is actually often a good luck stone. Sir Walter Scott''s novel &quot;Anne of Gierstein&quot; is believed to be one source of Opal''s disfavor. However, Queen Victoria loved Opals and often gave them as gifts! A fragile and sensitive stone, Opal is loved for its heavenly color play in fine jewelry and as specimens.</p>\r\n<p>Metaphysical Properties: Opal may be associated with water and the moon. It helps develop psychic abilities. It protects one during astral travel, and aids in the process. It may be used for past life recall. The gem also awakens one''s inner beauty and helps manifest this in the world. It aids creativity and interests in the arts. A stone for joy, it is full of passion and encourages spontaneity and optimism, and aids spiritual awareness. A sensitive and emotionally responsive stone, it helps us recognize our emotional states and understand them, to help open our hearts. Opal is a birthstone for October.</p>\r\n<p>Chakras: Al</p>', 'Opal', '', '', 1036, 'opal');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(25, '2010-04-11 01:22:35', '<p>     Lapis Lazuli is a sodium calcium aluminum silicate. A member of the Sodalite group, it forms in metamorphic limestone and is composed of the minerals Lazurite, Calcite and Pyrite. This deep royal blue stone has been prized for centuries. The name &quot;lazur &quot; is Arabic for &quot;blue&quot; and &quot;lazaward&quot; means &quot;toward heaven&quot;. The important ancient mines in Media, now Afghanistan, have been worked for over 5,000 years. The Badakhshan District of the Hindu Kusk Mountains borders Pakistan. In recent times, as before, donkeys loaded with precious Lapis travel down the mountains to Peshawar, Pakistan where it is sold. This fine Lapis seam runs north into Russia, but in only a few years this supply may be mined out. The ancient Sumerians valued Lapis above all stones. It was sacred to their goddesses Ereshkigal of the Underworld and Inanna, Goddess of the Heavens and Love. The Sumerians also paid tribute to Egypt with this stone as <br />      The Egyptians also found Lapis to be a spiritual and noble stone. It is mentioned in the Gilgamesh Legend and in Egyptian Papyrus. Sacred to Isis, Lapis was also sacred to the Christian&#39;s Virgin Mary in later times. A stone of heaven, the blue with pyrite resembles the star filled night sky. Lapis was also the &quot;Sapphire&quot; of the ancient Greeks. It was one of the stones in the High Priest&#39;s Breastplate. Ultramarine Blue, the artist&#39;s pigment, is powered Lapis. Modern Lapis is from Afghanistan, Russia and the Chilean Andes.</p><p>Metaphysical Properties: A stone of Venus and the heavens, Lapis Lazuli awakens intuition and psychic awareness. Used as talismans for protection or empowered with a deity&#39;s energy, it is a powerful stone. In meditation it focuses the mind for insights and wisdom and clarity. It helps with understanding emotional issues and the release of these as one reaches a higher level of consciousness and spirituality. It may aid memory, concentration and creativity. A stone to access timeless wisdom, foresight and inner truths. It strengthens and shields the aura, and aids in astral travel, past life work and the study of ancient sacred texts. A stone of friendship and divine love.</p><p>Chakras: Throat and Brow.</p>', 'Lapis', 'Lapis.jpg', 'Lapis.jpg', 1078, 'lapis');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(26, '2010-04-10 14:53:12', '<p>Ruby is the red variety of corundum. An aluminum oxide, its color is caused by chromium and it is found mostly in alluvial deposits with Sapphire, the blue to pink corundum. It is mined from placer deposits that are washed and sorted to find these crystals. A precious gem, second only to Diamond in hardness, Ruby has always been highly valued. The name Ruby is from Latin &quot;rubeus&quot;, and Corundum is from Sanskrit &quot;Kuruntan&quot;. Hindus considered it &quot;King of precious stones&quot;, &quot;Ratnaraj&quot; in Sanskrit. Burma, on India&#39;s eastern border, produced the finest rubies for centuries. Most valued have been the &ldquo;pigeon blood&rdquo; rubies from here. Rubies from Sri Lanka, Thailand and Tanzania are used as cut stones. </p>      <p>Star Rubies, caused by rutile needles in the stone are desirable. The star was believed to be the spirit living within the stone. A stone of noble privilege, rubies were believed to help amass wealth and provide invulnerability. They brought love and passion into life and were thought to help with blood disorders, or to heal or dispel battle wounds. Rubies carved with dragons were thought to increase wealth and vitality. </p>      <p>Rubies are also found in the U.S. In the 1800&#39;s, the Jenks Mine in Franklin, N.C. produced a 312 lb. Ruby crystal! </p>      <p>Metaphysical Properties: Ruby is a birthstone for July. A stone of passion, it stimulates Kundalini and increases vitality and strength. It helps with issues of willpower, courage, confidence, and determination and lessens weakness. A stone for love and joy. It stimulates sexual energy and aids childbirth, detoxifies blood.</p>  Chakras: Root, Spleen and Heart.', 'Ruby', 'Ruby.jpg', 'Ruby.jpg', 907, 'ruby');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(27, '2010-04-10 14:16:17', '<p>     Kunzite is a lithium aluminum silicate. It is the pink to lilac variety of Spodumene, found in granite pegmatite rock, often associated with Lepidolite, Tourmaline, Beryl or Albite. A colorless Spodumene called Triphane is mined as an ore for Lithium salts used in industry. A green Spodumene, Hiddenite, is found in North Carolina.</p><p>Kunzite was first found in 1902, in San Diego County, California. It was named for the famed geologist George F. Kunz, who first described this mineral. The name &quot;Spodumenos&quot; is from the Greek, and refers to some Spodumene&#39;s &quot;burnt to ash&quot; color. Kunzite&#39;s beautiful soft pink or lilac hues are caused by manganese. This lovely color may fade over time, particularly if exposed to bright light. Kunzite displays a form of luminescence, and will phosphoresce after exposure to ultraviolet light. The Etta Mine in the Black Hills of South Dakota was the source of the largest Spodumene crystal ever found. It was 42&#39; long, 5&#39; wide and weighed over 90 ton unknown to the ancients, Kunzite is a modern gem now used in jewelry and much admired. <br />      Metaphysical Properties: Kunzite&#39;s lovely pink vibration is useful to soothe the heart. It eases tension and stress, and one&#39;s responses to daily pressures. It is a gem to use in solitude, when one needs quiet and peace and self-nurturing. It also helps one to accept situations in life, which are beyond one&#39;s control, and may lead to a gentle surrender to the ways of spirit to handle matters. Kunzite&#39;s energy helps one to work with the angelic realm and the divine love available to all. Similar to Rose Quartz, yet with a more ethereal vibration. A meditation stone, useful to access the purity of one&#39;s inner heart, and to inspire self-expression of one&#39;s true feelings. It helps combine logic with intuition. It is useful to remove one&#39;s resistance to getting necessary tasks accomplished.</p><p>Kunzite may be used to ease nervous disorders and emotional problems. Passed over the body, it helps release stress in the energy field, and nerves and muscles.</p><p>Chakra: Heart and Brow.</p>', 'Kunzite', 'Kunzite.jpg', 'Kunzite.jpg', 1061, 'kunzite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(28, '2010-04-10 16:55:28', '<p style="text-align: center"><img alt="carnelian" width="132" height="118" src="http://www.stonegoddess.com/images/image/Stones/Carnelian.jpg" /></p>\r\n<p>Carnelian is a form of Chalcedony, microcrystalline quartz that forms near the earth''s surface under relatively low heat and pressure. Other members of the Chalcedony group are agates, onyx, bloodstone, jaspers, chrysoprase and the blue-grey Chalcedony. Carnelian''s rich warm hues of deep pink to red-brown and orange-red or honey yellow are caused by iron oxides in the stone. It is translucent to opaque, and has a waxy or dull luster. The name Carnelian, or Cornelian, may come from the Kornel Cherry, which has similar color. It could also come from &quot;carne&quot;, the Latin for flesh, as it has been associated with passion, earthiness and sexuality for centuries. Carnelian has also been called Canary Stone, Mecca Stone or Pigeon Blood Agate.</p>\r\n<p>Ancient Egyptians found the red stone symbolic of the sun''s disk and the Sun God Ra, or the blood of the Goddess Isis. Amulets of Carnelian would be inscribed with various passages from their Book of the Dead, depending on which deity was mentioned.</p>\r\n<p>Scarabs were sometimes carved of Carnelian. It could also symbolize the Ab or sacred heart-soul in a mummy''s body and, endowed with the power of Isis, could assist in resurrection in the after-life. These funerary amulets could protect the wearer in the underworld and ensure the favors of Osiris. In Pre-Dynastic Egypt drilled Carnelian beads were used, and in later times the stone was often combined with Lapis, Quartz and Gold in necklaces and pectorals.</p>\r\n<p>Moslems believed Carnelian could fulfill all desires, and a stone placed with the deceased could bring the spirit to paradise. Mohammed was said to wear a carnelian ring as a charm for the after-life. In Middle Eastern countries, the stone was thought to protect against the evil eye. Carnelian has been used as carved cameos for centuries. Cameo comes from Arabic &quot;khamea&quot;, meaning amulet! Carnelian or Sardius was mentioned in Exodus as one of the twelve stones in the breastplate of the High Priest, and as one of the foundation stones of the New Jerusalem.</p>\r\n<p>Idar-Oberstein. A community of skilled stone cutters in Germany''s Rhineland produced millions of Carnelian beads from the 1830''s until the 1970''s. This replaced the bead trade that had come from Canbay, India for centuries. Carnelian was associated with the blood of martyrs during medieval times. It has long been considered a protective stone, and a sturdy ornament. This red stone has been associated with the planets Mars and Jupiter and the element Fire.</p>\r\n<p>It is still popular in jewelry and its rich colors and warm glow make lovely cabochons that are loved by many. Much modern Carnelian is mined in Campa de Maia, on South America''s coast and some is from Australia, but Ratnapura in India produces the best quality stone.</p>\r\n<p>Metaphysical Properties: Carnelian is a stone of passion, motivation and courage. It helps one &quot;stand firm&quot; and manifests one''s life purpose. It inspires creativity and action on one''s dreams and vision, and aids success in business and life choices. It is grounding or &quot;earthling&quot; stone, which can help, transmute negative energies. It helps one-focus and calms emotions of anger, envy and hostility. It may ease survival fears and ground one in present reality. It stimulates the metabolism, aids childbirth and menstrual problems and directs Kundalini.</p>\r\n<p>Chakras: Root, Spleen, Solar Plexus, Heart.</p>', 'Carnelian', '', '', 1282, 'carmelian');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(29, '2010-04-11 03:27:20', '<p>Rhodochrosite is a manganese carbonate which forms in the oxidation zone of ore deposits or as a mineral precipitated from hydrothermal solutions. It is associated with copper, silver, lead and other manganese minerals. It may also be found with Rhodonite, barite, galena, chalcopyrite, sphalerite and other minerals. It occurs mostly in massive form, or as concretions or stalagmites. </p>      <p>Crystals are rare, but exquisite Rhodochrosite crystals, up to 2&quot; across, have been collected from the Sweet Home Mine in Colorado. Hotazel in South Africa has produced fine crystal specimens. Crystals have also been found in Rumania, Spain and France. </p>      <p>The manganese present in the stone cause Rhodochrosite&rsquo;s beautiful pink to rose hues. The name Rhodochrosite is derived from the Greek &quot;Rhodon&quot; for red and &quot;chros&quot; for color.  </p>      <p>The Rhodochrosite deposits in Argentina have been mined for years for their beautiful banded rose and pink or &quot;bacon strip&#39; stone used for decorative carvings, boxes and jewelry. These important deposits were formed in the 13th century as stalagmites in abandoned Inca silver mines near San Luis. Peru is also a source for the mineral. Inca Rose is another name for the stone, as some Andean natives believe that the blood of the ancient Incas rulers was turned into this pink stone. </p>      <p>It is the main ore source for manganese when found in large enough deposits. Rhodonite is another pink stone sometimes confused with Rhodochrosite. </p>      <p>Metaphysical Properties: This is a stone of love, peace and harmony. Simply to gaze upon its joyful rose colors can make one feel happy, calm and content. It may be used to attract love and harmonious relationships. It may even attract one&#39;s soul mate. It soothes stress and eases the anguish and uncertainty of change and transformation on life&#39;s journey. It aids forgiveness and heals old wounds as one accepts the past, comes to terms with life and moves forward on one&#39;s path. It may be worn or carried, or even placed in the tub for a soothing bath. A stone of unconditional love and compassion, it helps open the heart with gentle awareness of all that is needed for healing and growth. It also helps to remind us to love and care for our great Mother Earth. </p> Chakras: Heart and Root.', 'Rhodochrosite', 'Rhodochrosite.jpg', 'Rhodochrosite.jpg', 1344, 'rhodochrosite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(30, '2010-04-11 08:09:23', '<p>     Garnet is the name given to a group of Aluminum Silicates with related chemical content and identical crystal structure. Most are found in metamorphic rocks. Pyrope or Bohemian Garnet, and Almandine Garnet are the most widely known and used in jewelry. The &quot;Carbuncle&quot; of medieval times and the Crusades was Almandine Garnet. Warriors to protect against injury in battle and to bring good luck and fortune wore it. It also symbolized the heart and enduring love and friendship. Garnet jewelry was worn as early as the 6th century by the Scythians, and Pliny first called the stone Carbuncle. In 16th century Bohemia, it was worn against witch&rsquo;s spells. It was believed to protect the wearer from enemies and thieves, and to bring love. <br />      Pyrope derives its name from the Greek Pyropos for &#39;Fiery eyed&quot;. It was very popular in Victorian times until it became too common. Now these pieces are highly desirable estate jewelry. Rhodonite, another gem garnet, was first found in Macon County, NorthCarolina in 1893. A beautiful rose hue, it is now found in Ceylon and other areas. In New York City, in 1893 a garnet crystal of over 9lbs. Was found in an excavation right Off-Broadway!</p><p>Early Romans carved cameos and intaglios of Garnet. A lion carved on garnet could preserve health, wealth and honor. Albertus Magnus said garnet improves blood circulation and strengthens the heart, stops heart palpitations and strengthens blood flow. It could also avert the plague and thunderstorms! The name &quot;granatum&quot;, from Pomegranite, shows that the red jewel has long been a symbol of ancient feminine life force and the womb.</p><p>Garnet occurs in every color except blue. Andradite, Grossulars and Uvarovite are some of the other hued garnets, brown, yellow, green and colorless. Common garnet is used in industry as an abrasive. Large Spessartine garnets have come from the Rutherford Mine in Amelia, Virginia.</p><p>Metaphysical Properties: Garnet is a birthstone for January. It is a stone of passion and of transformation. It helps in release of old patterns and gives courage to begin anew. It stimulates and helps the flow of Kundalini and of sexual energy. It also helps control anger. A stone for purity of heart, it is symbolic of love and loyalty. It aids in childbirth and with menstrual problems, and has long been associated with the blood. An energizer and revitalizes, healing and protective, good for strength and knowledge of what is needed for survival.</p><p>Chakras: Root and Heart</p>', 'Garnet', 'Garnet.jpg', 'Garnet.jpg', 1112, 'garnet');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(31, '2010-04-11 07:33:40', '<p>     Fluorite is calcium fluoride, a mineral that forms in a variety of diverse environments. In hydrothermal veins, it is often associated with lead, zinc or silver ores and found with calcite, barite, galena, sphalerite or other related minerals. Crystals are cubes or octahedron, and it also occurs in massive form. Fluorite&#39;s color varies from transparent, white, yellow, and blue to violet, green and sometimes pink. <br />      Banded or zoned Fluorite is particularly beautiful, and is used in carving, jewelry and other polished items. Vases of carved Fluorite were found in ancient Alexandria, and artifacts of Fluorite were found in the ruins of Pompeii. Ornaments of Fluorite were used by early Native Americans and included in Mound burials in the present state of Illinois.</p><p>Rosiclaire Lead Mine in Hardin County, Illinois has produced crystals up to one foot across! Cave In Rock, Illinois and Elmwood, Tenn. are sources of beautiful specimens. Durango, Mexico and Hunan Province, China also have lovely fluorides. England and Italy have wonderful Fluorides; Derbyshire&rsquo;s Blue Jack is one example. Amelia Courthouse, Va. has a rare chlorophane fluorite, which is phosphorescent under low temperatures.</p><p>Most fluorite is fluorescent under UV light. The name is from Latin &quot;fluere&quot;, &quot;to flow&quot;, as the mineral melts easily and is used as a flux in ore smelting. It is used to produce hydrofluoric acid, and fluoride is used in some toothpaste.</p><p>Metaphysical Properties: Fluorite is an ideal ally as we work to live harmoniously on our Mother Earth. All Fluorite helps balance our lives, creating stability and order from chaos. It helps ease tensions when things are in a &quot;state of flux&quot;. It eases emotional upsets and allows release of obstacles in the way of harmony. Fluorite aids the intellect, and orders information and ideas. A good stone for the desk and work area, and for the home. It shields the aura and helps ground energies. Purple Fluorite stimulates psychic and spiritual activity; Green Fluorite promotes calm and gentle healing. Blue Fluorite aids clear communications and yellow inspires creativity. All Fluorite works with us as co-creators of a healthy and balanced home or work environment. A popular and beautiful stone, for meditation, gazing upon, touching and just to enjoy the comfort it brings!</p><p>Chakras: All</p>', 'Fluorite', 'Fluorite.jpg', 'Fluorite.jpg', 1081, 'fluorite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(32, '2010-04-10 14:15:52', '<p>Smithsonite is a zinc carbonate, a sedimentary mineral that occurs in the oxidation zone of sulfur rich lead or zinc or copper deposits. It is often associated with hemimorphite, galena, cerrusite, Azurite, malachite and several other related minerals. Crystals are rare, but the botryoidal or mammillary massive forms of Smithsonite can be quite beautiful and intriguing. It is an allochromatic mineral, which takes its various colors from trace elements present. The blue-green Smithsonite contains copper, the pink or violet has manganese or cobalt, the yellow hue is from cadmium and the brown is from iron. The stone is a zinc ore, and the more colorful forms are sometimes used for ornament, particularly the copper bearing blue-green stone which is sometimes used as a Turquoise imitation. It is named for James Smithson, the founder of the Smithsonian Institution. </p>      <p>It is found in many localities around the world, and several areas produce beautiful specimens. The blue-green examples from the Kelly and Magdelena mines in Socorro County, New Mexico and those from mines in Inyo County, California are some of these. Mexico, Italy, Greece and other sites also have fine specimens. </p>      <p>Metaphysical Properties: Smithsonite has similar spiritual qualities as Chrysocolla and Turquoise, but to a lesser degree and a slightly lower vibration. It is a stone useful to help complete desired goals, and to keep the mind clear and aware and focused on the task at hand. It is a stone for stability and security, and is conducive to aiding relationship issues to bring more comfort and harmony and balance to a home or work place. </p>      <p>It also helps with Chakra activation and alignment, directing primary vital force through the body to enhance physical strength and health. It may also help the intuitive to see or hear psychic messages and have a clearer understanding of them.  </p>      <p>It may be used as a &quot;substitute&quot; stone in Chakra grids for healing work, and may lessen immune disorders. It is associated with the planets Mercury and Jupiter, the signs Virgo and Sagittarius and the elements air and fire. </p> Chakras: Throat, Heart and Spleen.', 'Smithsonite', 'Smithsonite.jpg', 'Smithsonite.jpg', 1349, 'smithsonite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(33, '2010-04-10 14:16:12', '<p>     Citrine is a silicon oxide mineral that is found in igneous rocks, pegmatite and alpine or hydrothermal veins. It is the yellow member of the quartz family and grows as large crystals or Druze. The color ranges from pale to golden yellow or orange to brown, and is caused by ferric iron oxides in the mineral. Natural Citrine is rare, and most Citrine available is the result of heat-treating of amethyst or smoky quartz to produce the Citrine hues. This process has been done for centuries, beginning in the Middle Ages.</p><p>Citrine was one of the stones used in the Breastplate of the High Priest. It was also highly regarded by Celtic and Scottish peoples. The name Citrine comes from the Latin citrus or citron, for the yellow color. It was not until 1546, however, that &quot;Citrine&quot; was identified as only the yellow variety of quartz. Before this time, many yellow stones were called Citrine. This confusion continues to the present day, as Citrine has a strong resemblance to Golden Topaz. It has been sold under names such as Madeira Topaz and Bahia or Rio Grande Topaz. These are all a buyer must be wary of this deceit. The beautiful warm glow of Citrine makes lovely jewelry and stone carvings.</p><p>Citrine phantoms are rare and interesting crystals, as is Ametrine, a mineral that combines the royal purple of Amethyst with the warm glow of Citrine. Brazil is the main source of Citrine today, while some comes from Madagascar.</p><p>Metaphysical Properties: Citrine&#39;s bright glow, like the golden rays of the sun, helps ease depression and create a cheerful mood. It disperses negative energies, and is useful for clearing the aura and aligning the Chakras. It needs no cleansing. A large crystal or cluster in the home or workplace can help create a happy, abundant energy flow. A stone for prosperity, it is a good one for merchants, or to use with affirmations for personal wealth and self-worth. It inspires creativity, strengthens the intellect and aids memory. It helps shed light on a matter so decisions can be made with confidence and ease. It boosts self-confidence and willpower, and helps dispel negative thoughts and fears that may predispose one to illness. It may also protect from nightmares. It may help the liver, kidneys and digestive or urinary tracts and lymph system to remove toxins from the body. Citrine&#39;s gentle energy combines well with other stones.</p><p>Chakras: Solar Plexus and Crown.</p>', 'Citrine', 'Citrine.jpg', 'Citrine.jpg', 1130, 'citrine');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(34, '2010-04-08 23:00:34', '<p>Amethyst is a silicon dioxide, the purple member of the Quartz family, found in pegmatite rocks of igneous origin, and as geodes in alluvial deposits. The violet, lavender and red purple shades are caused by ferric iron in the stone. Sometimes Amethyst may contain a warm golden citrine that creates another mineral, Ametrine, when they are found together. Natural Ametrine has been mined in Brazil and Bolivia, although much is produced by heat treating Amethyst. Amethyst Quartz, which is banded purple and white is also found. Amethyst occurs in many areas worldwide, but Brazil and Uruguay are the two most important commercial sources. In the U.S., beautiful Amethyst specimens have been found in Maine, Virginia, the Carolinas and Georgia. Canada and Mexico also have good specimens, the Vera Cruz, Mexico crystals being most delicate and desirable. Crystal Geodes of Amethyst have formed that are large enough for a person to stand in. Amethyst Cathedrals, as these are called, are sometimes found with stars of white calcite growing upon them, which adds to their beauty. </p>      <p>The name &quot;Amethystos&quot; is Greek for &quot;not intoxicated. The stone was used as an amulet to protect one from drunkenness. It was also believed to drive away evil thoughts and demons. It was used to calm the mind, and to aid spiritual insight. In Medieval times, this gem was highly valued by the clergy. </p>      <p>A stone revered for centuries, Amethyst beads have been found in Egyptian sites dating to 3,500B.C. It was combined with Carnelian, Turquoise or Garnet, and was also carved into amulets bearing animal images. St. Valentine&#39;s ring was said to contain Amethyst carved with a Cupid! Now amethyst is faceted, cabochon cut or carved into ornaments. A birthstone for February, it is a gem that everyone loves! </p>      <p>Metaphysical Properties: The gentle, protective energy of Amethyst makes it one of the basic healing stones. It eases stress and depression, and helps integrate spiritual energies into everyday life. It aids psychic ability and intuition, and connects one with higher wisdom. Placed under a pillow, it controls bad dreams. It is useful in meditation, and in affirmations for emotional and physical healing. It promotes sobriety, and helps overcome addictions. Its calm vibration relaxes the spirit and nervous system, to help with physical healing.  </p> Chakras: Brow, Crown', 'Amethyst', 'Amethyst.jpg', 'Amethyst.jpg', 1353, 'amethyst');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(35, '2010-04-10 14:15:41', '<p>Sapphire is the name given to most members of the Corundum group, aluminum oxide minerals that are formed in a variety of host rocks under extreme heat and pressure. Found in weathered volcanic basalt or dolomite limestone&rsquo;s, Sapphires are mostly mined from alluvial or placer deposits. Rich deposits in Sri Lanka were formed over one million years ago. </p>      <p>The red corundum Ruby is the only one not grouped under Sapphire&#39;s name. All other hues from white, pink, green, yellow, violet and the most desirable and valuable cornflower and royal blues are Sapphires. Iron and Titanium in the crystals create the blue, vanadium causes a violet hue and chrome creates pink. The stones &quot;Oriental Topaz&quot;, and &quot;Oriental Emerald&quot; are really Sapphires. The rarest color is the orange &quot;Padparadschah&quot;, or &quot;Lotus Flower&quot;. </p>      <p>Sapphires have a long history as a sacred stone. It is a symbol of the heavens, a stone also associated with Saturn. The Sanskrit &quot;sauriratna&quot;, Chaldean &quot;sampir&quot;, Latin &quot;Saphirus&quot; and Greek &quot;Sappheiros&quot; are just some of its ancient names. However, Sapphire was a name given to most blue gems until the 1800&#39;s when it was found that Sapphire and Ruby were conundrums. The early biblical &quot;Sapir&quot; was actually Lapis Lazuli. Still. In the 12th century the Pope decreed that all Bishop&#39;s Rings should contain Sapphire, a stone believed to represent spiritual truth, clarity and enlightenment. It was also thought to increase the desire for knowledge, and bring peace of mind. </p>      <p>Revered by Buddhists, Sapphire brought peace and friendship, and was a talisman for marital bliss. The Hindus have always admired it as a holy stone of truth and justice, and as a bringer of good fortune. Kashmir Sapphires have been most desirable, but those sold as &quot;Kashmir&quot; now is mostly mined in Burma. </p>      <p>Star Sapphires are thought most magical, as the rutile hairs in the stone create the effect of light rays moving within. These spirits within the gem were &quot;Faith, Hope and Destiny&quot; and were thought to observe and reward the owner of the gem.  </p>      <p>Metaphysical Properties: Sapphire&#39;s soft twilight blue and serene, calm energy brings a restful tranquil mind. It allows one to focus on the higher self and one&#39;s true nature. It fosters independence and self-responsibility. It aids communication and psychic awareness. Star Sapphire is a good meditation gem; aids astral travel and promote dreams, joy and happiness. May be used to purify the aura. </p> Chakras: Throat and Brow.', 'Sapphire', 'Sapphire.jpg', 'Sapphire.jpg', 1017, 'sapphire');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(36, '2010-04-10 11:55:30', '<p>Topaz is an aluminum fluorsilicate that forms in igneous rocks and high temperature veins. It is found as crystals with quartz, beryl, albite or orthoclase in pegmatites or in alluvial deposits as river worn pebbles. The colors of Topaz may be white, pink, blue, yellow, green or red. Most natural Topaz is colorless, while pink and a deep golden yellow are highly prized. Iron and chrome are the coloring agents. Today, heat-treating creates much blue, violet or red topaz. </p>      <p>Topaz may be easily confused with Aquamarine, Citrine, Diamond, and Kunzite, Phenakite and other stones. In the gem trade, a buyer must be wary of Citrine being sold as &quot;Madeira Topaz&quot;. A warm golden to sherry brown &quot;Imperial Topaz&quot; is mined in Minas Gerais, Brazil. The main sources of the gem are Brazil, the Ural Mtns. and Sri Lanka. In the U.S., Topaz specimens have been found in Conway, N.H., Pikes Peak, Colo., Thomas Mtn., Utah, as well as other areas. </p>      <p>The name &quot;Topaz&quot; may be from the Greek &quot;Topazes&quot; for the island now known as Zebriget, or it may be from the Sanskrit &quot;Tapas&quot; which means fire. In the past, the name was used for most yellow gems. In London, a 13-lb. Topaz crystal was being used as a doorstop until it was identified and placed in the British Museum of Natural History. In 1964, Blue Topazes weighing 220 lbs. each were found in the Ukraine! </p>      <p>Metaphysical Properties: A birthstone for November, particularly Golden Topaz. Topaz is useful to develop empathy and compassion; it shows us how to love and to open communication from the heart. It may help one be adaptable and find humor, and gain spiritual insight after long difficult times. Topaz can stimulate the body&#39;s energy flow and strengthen the nerves. </p>      <p>A good meditation stone, for self-realization and to use with healing affirmations and to visualize the physical body as an acceptable part of the spiritual self. </p>      <p>Yellow Topaz boosts self-confidence and awareness, and ease nervous exhaustion. It may be worn to attract wealth or helpful friends. Blue Topaz helps with clear communications, and Pink Topaz is a heart stone. All are protective and direct energy to manifest one&#39;s abilities. </p> Chakras: Solar Plexus, Heart, and Throat.', 'Topaz', 'Topaz.jpg', 'Topaz.jpg', 1049, 'topaz');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(37, '2010-04-11 07:08:28', '<p style="text-align: center"><img alt="chrysoprase" width="130" height="100" src="http://www.stonegoddess.com/images/image/Stones/Chrysoprase.jpg" /></p>\r\n<p>Chrysoprase is a silicon dioxide mineral, microcrystalline quartz, and the apple green variety of chalcedony. It is formed at low temperatures near the earth''s surface, and is found in a variety of mineral environments, and Serpentinite veins. The gem''s yellow-green or nickel oxides cause apple green color. This green is similar to some jade, variscite, prehnite or smithsonite.</p>\r\n<p>The name Chrysoprase is from the Greek chrysos and prason for &quot;golden leek&quot; or &quot;golden green&quot;. The ancient Greeks and Romans, who carved it into intaglios, signet rings and brooches, valued the stone. It was often associated with the Goddess Venus, and was a talisman to protect the wearer from the evil eye, curses and envy. Alexander the Great was said to always wear Chrysoprase into battles. The Egyptians adorned themselves with Chrysoprase, combined with Lapis Lazuli and other gems, as early as 1500 BC It was also thought to be a stone in the High Priest''s Breastplate, and a foundation stone for the New Jerusalem.</p>\r\n<p>Old Romanian folk belief said the gem would enable the wearer to understand the language of lizards! Hildegard Von Bingen considered it a detoxifier, and a calming stone for anger. It was a popular stone in 14th century Europe. Chrysoprase was also the favorite stone of England''s Queen Anne. It remained popular there for years, through Queen Victoria''s reign.</p>\r\n<p>Important historical sources of the stone were Poland and Czechoslovakia. Modern sources are Australia, Brazil, California and Oregon in the U.S., Africa and India. It was also recently found in Serbia and Kazakhstan. Today the gem is used for handsome jewelry and beautifully detailed carvings.</p>\r\n<p>Metaphysical Properties: The cool green energy of Chrysoprase gently calms the heart It eases emotional issues, and allows unconscious images and thoughts to be understood so healing may occur and peace and harmony will prevail. It is an aid in seeing our truth, releasing old thought patterns, and inspires new ideas and creativity and use of hidden talents. It brings a sense of peace during times of chaos and change. A stone to attract good luck in new enterprises, and to bring abundance and new friends. It lessens envy and anger, eases anxiety and allows for a sedate and tranquil heart. It may soothe heart palpitations. It helps in self-trust, so one may be truly independent and content with oneself. It creates serenity and feelings of security, and an angelic connection to divine source.</p>\r\n<p>A stone for gardeners, Chrysoprase allows communication with plant energies and devas, the earth and the spiritual aspects of nature. Its color is like sunlight through summer leaves, and reminds us of the cycles of birth, growth and death in nature and our own lives, and lets us gain strength and wisdom by understanding these cycles.</p>\r\n<p>Chakras: Heart and Solar Plexus.</p>', 'Chrysoprase', '', '', 1163, 'chrysoprase');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(38, '2010-04-10 14:15:46', '<p style="text-align: center"><img alt="shiva lingam" width="131" height="79" src="http://www.stonegoddess.com/images/image/Stones/SHIVA%20LINGAM.jpg" /></p>\r\n<p>These sacred stones from Narmadr River, one of India&rsquo;s most holy sites, are now uncrated on display at the Stonegoddess. Rare because they are over 100 pounds. Cone sees the shapes and markings that make this find so rare.</p>', 'SHIVA', '', '', 2173, 'shiva-lingam');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(39, '2010-04-10 15:56:57', '<p>     Aragonite is a calcium carbonate mineral, which may contain traces of strontium, lead or zinc. A polymorph of calcite, it is found in a variety of environments. It occurs in low temperature hydrothermal veins or as deposits at Hot Springs and precipitates or evaporates from chemicals in sedimentary rocks. It is also found in the shells and skeletons of fossilized sea creatures. The colors are white, yellow or reddish brown, and sometimes pink or blue. The name &quot;Aragonite&quot; comes from the Molina de Aragon in Spain, where it was first found in 1788.</p><p>Aragonite occurs worldwide, but the best specimens are the reddish-brown pseudohexagonal crystals from Spain and Morocco, and the delicate white &quot;Flos Ferri&quot; or &quot;flowers of iron&quot; which are found in the Magdelena district of Socorro, New Mexico. The only Aragonite of gem quality for facetted stones was found in Horenec, in the Czech republic. Stalactitic masses occur in Arizona and Mexico. The &quot;cave pearls&quot; of Luray,Va. and other American caves are also Aragonite. Mexican onyx is actually Aragonite. The main deposits are near Tecali in the state of Pueblo. The attractive variegated color bands are caused by traces of iron and manganese oxides in the stone.</p><p>It is carved across these bands to produce a veined effect. It was used by the native peoples for masks, statuary and other objects. In the 15th century, Bernadino de Sahagun wrote of &quot;iztec chalchihuitl&quot;, a fine green and white translucent stone used for carving. In 1876, the stone was introduced to Europe, where it became very popular and sold for exorbitant prices. Near Pueblo, the natives still carve everything from crucifixes to stone fruit or paperweights from it. Pakistan onyx and alabaster are also Aragonite. The lovely lustrous nacre of pearls and the soft glowing mother of pearl are Aragonite formed by sea creatures from calcium in the water.</p><p>Metaphysical Properties: Aragonite&#39;s six-sided crystal forms are good meditation stones. They symbolize the hexagram and the Star of David or Solomon&#39;s Seal. The crystal clusters show us how the individual relates to the whole universe. They radiate outward from the center as a seed, or individual soul, that grows and manifests itself through life&#39;s experiences. They remind us of our center, as new energies enter us or appear around us as life events. They represent our own spiritual and physical growth, from the &quot;seed&quot; of self and how it interacts with the world and life. A talisman to represent this center or &quot;flower&quot; of self, and how we grow in knowledge and strength through myriad life experiences. A good stone for family and companionship, it is also a calming stone which eases inner restlessness and nerves. It is a stabilizer and grounding stone, and aids emotional balance. A centering stone, it directs energy and self-discipline and helps one to persevere and move past old limitations and experience more of what life has to offer. It is also useful as a gem elixir.</p><p>Chakras: Root and Spleen.</p>', 'Aragonite', 'Aragonite.jpg', 'Aragonite.jpg', 1189, 'aragonite');
INSERT INTO `StoneTalk` (`recno`, `dateadded`, `descri`, `itemname`, `image`, `file1`, `views`, `linkname`) VALUES(40, '2010-04-11 18:30:19', '<p style="text-align: center"><img alt="charoite" width="129" height="97" src="http://www.stonegoddess.com/images/image/Stones/Charoite.jpg" /></p>\r\n<p>Charoite is a very complex mineral. A unique and rare composition of potassium/sodium, calcium/barium and strontium, a hydrous silicate. It was formed in a unique geologic event, when limestone&rsquo;s were altered by an intrusion of magmatic alkaline nephline syenites, which occurred over an area of only about four miles, along the Charo River in the east central Siberian wilderness. The mineral is 90% Charoite, with the other 10% being green aegirine, yellow tinaksite and green-white nepheline with scattered grains of quartz and ore minerals. Its striking purple color may be caused by traces of manganese, strontium and barium. It is this lovely purple that caused the stone to be sold at extravagantly high prices when first introduced to the western market in 1976. Sources differ about the year it was first found in the USSR, as early as 1947 or as late as the mid 1950''s. When work was done to extend the TransSiberian Railroad in the Murin Massif, more Charoite was discovered, in dikes and lens-like masses, along the Charo River Valley, in the Charo Region, about 325 miles NE of the northern tip of Lake Baikal.</p>\r\n<p>It was first officially recognized as an independent mineral in 1978. This beautiful and intriguing, hypnotic violet or lilac stone, is used for ornamental carving, cabochons in jewelry and beads. Similar stones are Sugilite or lazulite.</p>\r\n<p>Metaphysical Properties: Charoite is useful for cleansing and purifying the aura, and to transmute negative energy. A symbol of individuality, it can help one have the courage and determination to release fears, and move beyond previous limitations caused by them. It encourages self-exploration and new life plans, and helps one strive to fulfill dreams. It promotes restful sleep and, placed under the pillow, may bring pleasant dreams. It may be used to rekindle lost passion and intimacy in relationships. It stimulates unconditional love, and soothes the restless spirit.</p>\r\n<p>Charoite helps one cope with times of major changes and transformations in life. It relieves stress and headache, and calms the nerves. It helps one relax, and to think clearly, to make decisions that are necessary for spiritual growth. A spiritual stone, it unites the crown, brow and heart Chakras, and stimulates the pineal gland to enhance psychic ability, clairvoyance and heart-felt intuition. A beautiful stone that helps bring magic and spiritual connection into our daily lives. It is a stone for inspiration and creative visions and dreams. Charoite allows for an angelic consciousness to help earth and her creatures make a transformational leap and are open to higher vibrations, new energies and ideas.</p>\r\n<p>Chakras: Crown, Brow and Heart.</p>', 'Charoite', '', '', 1346, 'charoite');
